import { hover } from "@testing-library/user-event/dist/hover";
import React from "react";
import styled from "styled-components";
import IPhone from "./iPhone/iPhone";

const Main = () => {

    return (
        <MainContainer>
            <MainLeftSide>
                <FirstString>Цифровое решение для вашего бизнеса</FirstString>
                <SecondString>Полный цикл разработки</SecondString>
                <ThirdString>Уникальные решения</ThirdString>
                {/* <OurProjects style={{ animationDelay: `calc(var(--scroll) * -1s)` }}>Наши проекты</OurProjects> */}
            </MainLeftSide>
            <MainRightSide>
                <IPhone bgcolor={'white'} />
            </MainRightSide>
        </MainContainer>
    )
}

const MainContainer = styled.div`
    width: 70%;
    min-height: 100vh;
    margin: 90px auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const MainLeftSide = styled.div`
    width: 45%;

`

const FirstString = styled.h1`
    color: black;
    animation: mainPageFirst 0.2s ease-in 1s 1 normal both;
`

const SecondString = styled.h1`
    animation: mainPageSecond 2s ease-in 2s 1 normal both;
`

const ThirdString = styled.h1`
    animation: mainPageSecond 2s ease-in 4s 1 normal both;
`

const OurProjects = styled.h1`
    position: fixed;
    top: 50%;
    animation: mainPage 0.5s linear infinite;
    animation-play-state: paused;
    /* animation-delay: calc(var(--scroll) * -1s); */

    animation-iteration-count: 1;
    animation-fill-mode: both;
`

const MainRightSide = styled.div`
    position: fixed;
    top: 90px;
    right: 15%;
`

export default Main
